import React from 'react';
import hero from '../assets/home/photoguy.png';
import { Link } from 'react-router-dom';

import { motion } from 'framer-motion';

import { transition } from '../transitions';

const Home = () => {
  return (
    <section className='section'>
      <div className='container mx-auto h-full pt-30 relative'>
        <div className='flex flex-col lg:flex-row h-full items-center justify-center lg:pt-16 gap-x-24 text-center lg:text-left'>
          <div className='flex-1 lg:pt-36 pb-14 lg:pt-0 lg:w-auto z-10 flex flex-col justify-center lg:items-start'>
            <h2 className='h1'>Nature &<br />Landscape <br />Photographer</h2>
            <p className='text-[26px] lg:text-[36px] font-primary mb-4 lg:mb-12'>San Francisco, CA | Dallas, TX</p>
            <Link to='/contact' className='btn mb-[30px]'>Let's Connect</Link> 
          </div>
          <div className='flex-1 max-h-96 lg:max-h-max order-2 lg:order-none overflow-hidden'>
            <img src={hero} alt='hero' />
          </div>
        </div>
      </div>      
    </section>
  );
};

export default Home;
